        event.preventDefault();

        const article = {
            title: this.state.title,
            content: this.state.content
        };

        axios.post(`http://localhost:5000/articles`, { article })
            .then(res => {
                console.log(res);
                console.log(res.data);
            })
    }

    render() {
        return(
            <form method='POST'>
                <label>
                    Title: 
                    <input type='text' name='title'></input>
                </label>
                <label>Content</label>
            </form>
        );
    }
}
